INSERT INTO `indikator_news_posts` (`id`, `title`, `slug`, `introductory`, `content`, `published_at`, `status`, `statistics`, `created_at`, `updated_at`, `image`, `featured`, `last_send_at`, `category_id`, `enable_newsletter_content`, `newsletter_content`, `user_id`, `tags`, `seo_title`, `seo_keywords`, `seo_desc`, `seo_image`) VALUES
(1, 'Vì sao Mỹ Đình được nhiều người nước ngoài lựa chọn sinh sống', 'vi-sao-my-dinh-duoc-nhieu-nguoi-nuoc-ngoai-lua-chon-sinh-song', '<p>Vài năm trở lại đây, lượng người nước ngoài sinh sống tại Việt Nam gia tăng đáng kể. Tại Thủ đô cũng đã xuất hiện nhiều cộng đồng người nước ngoài sinh sống. Sở hữu nhiều ưu thế, khu vực Mỹ Đình – Mễ Trì được xem là nơi an cư của rất nhiều người nước ngoài, đặc biệt là người Châu Á như Nhật Bản và Hàn Quốc.</p>', '<p>Vài năm trở lại đây, lượng người nước ngoài sinh sống tại Việt Nam gia tăng đáng kể. Tại Thủ đô cũng đã xuất hiện nhiều cộng đồng người nước ngoài sinh sống. Sở hữu nhiều ưu thế, khu vực Mỹ Đình – Mễ Trì được xem là nơi an cư của rất nhiều người nước ngoài, đặc biệt là người Châu Á như Nhật Bản và Hàn Quốc.</p>\r\n\r\n<h2><strong>Hạ tầng giao thông đồng bộ hiện đại</strong></h2>\r\n\r\n<p>Được đầu tư phát triển theo chủ trương của UBND Thành phố Hà Nội, Mỹ Đình dẫn trở thành một trong những khu vực sở hữu hệ thống hạ tầng giao thông, quy hoạch đồng bộ và hiện đại hàng đầu tại Thủ đô.</p>\r\n\r\n<p><img src=\"http://localhost/mipec-xuanthuy/storage/app/media/uploaded-files/1574789150303.jpeg\" alt=\"Hạ tầng đường xá giao thông khu vực Mỹ Đình\" width=\"1300\" height=\"836\" srcset=\"https://matrixonemetri.com/wp-content/uploads/2019/11/ha-tang-duong-xa-giao-thong-khu-vuc-my-dinh.jpg 1300w, https://matrixonemetri.com/wp-content/uploads/2019/11/ha-tang-duong-xa-giao-thong-khu-vuc-my-dinh-622x400.jpg 622w, https://matrixonemetri.com/wp-content/uploads/2019/11/ha-tang-duong-xa-giao-thong-khu-vuc-my-dinh-768x494.jpg 768w\" sizes=\"(max-width: 1300px) 100vw, 1300px\" class=\"fr-fic fr-dii\" data-result=\"success\"></p>\r\n\r\n<p>Định hướng phát triển trở thành trung tâm hành chính mới, bởi thế mà Mỹ Đình được đẩy mạnh phát triển hệ thống giao thông với nhiều trục đường huyết mạch như Phạm Hùng, Vành đai 3, Vành đai 3.5, Hàm Nghi, Lê Đức Thọ, Mễ Trì, Đại lộ Thăng Long,…Bên cạnh đó, dự án tuyến đường sắt đô thị Nhổn – Ga Hà Nội cũng đang được triển khai và sớm hoàn thiện và làm hoàn thiện hơn hệ thống giao thông công cộng trong khu vực.&nbsp;</p>\r\n\r\n<p>Nhờ thế mà cư dân khu vực Mỹ Đình có thể dễ dàng di chuyển, kết nối đến khu vực trung tâm phố cổ hay sân bay Nội Bài rất dễ dàng và thuận tiện. Chính sự thuận lợi trong kết nối đã khiến cho nhiều người nước ngoài lựa chọn định cư tại nơi đây.</p>\r\n\r\n<h2><strong>Cộng đồng người Hàn tập trung đông tại Mễ Trì</strong></h2>\r\n\r\n<p>Trong vòng chưa đến một thập kỷ, đã có tới hơn 100.000 người Hàn Quốc đang sống và làm việc tại Việt Nam tại hai thành phố lớn là Hà Nội và TP Hồ Chí Minh.&nbsp;</p>\r\n\r\n<p>Tại Hà Nội, cộng đồng người Hàn Quốc tập trung đông đảo tại khu vực Mễ Trì tạo thành khu phố người Hàn tại nơi đây. Người Hàn sinh sống tại khu vực này chủ yếu là các doanh nhân, giới tri thức và thượng lưu. Cuộc sống tại nơi đây vừa thuận tiện kết nối đồng thời với các dự án căn hộ đẳng cấp, họ được tận hưởng các dịch vụ tiện ích chất lượng hàng đầu với các yếu tố xứng tầm quốc tế.</p>\r\n\r\n<p><img src=\"http://localhost/mipec-xuanthuy/storage/app/media/uploaded-files/1574789150848.jpeg\" alt=\"Phối cảnh khu đô thị Mễ Trì\" width=\"1600\" height=\"1118\" srcset=\"https://matrixonemetri.com/wp-content/uploads/2019/11/phoi-canh-khu-do-thi-me-tri.jpg 1600w, https://matrixonemetri.com/wp-content/uploads/2019/11/phoi-canh-khu-do-thi-me-tri-572x400.jpg 572w, https://matrixonemetri.com/wp-content/uploads/2019/11/phoi-canh-khu-do-thi-me-tri-768x537.jpg 768w\" sizes=\"(max-width: 1600px) 100vw, 1600px\" class=\"fr-fic fr-dii\" data-result=\"success\"></p>\r\n\r\n<p>Một số dự án có đông người Hàn sinh sống tại nơi đây có thể kể tới như khu đô thị The Manor hay tòa căn hộ Keangnam đẳng cấp.</p>\r\n\r\n<p>Với lượng người Hàn đông đảo sinh sống và làm việc, xung quanh các dự án dần mọc lên những khu phố phục vụ nhu cầu của người nước ngoài với các quán ăn, cửa hàng tiện ích,… mang đậm phong cách Hàn Quốc với chi phí khá đắt đỏ, chất lượng tuyệt vời.</p>\r\n\r\n<h2><strong>Nơi có nhiều trường học quốc tế, bệnh viện và trung tâm mua sắm</strong></h2>\r\n\r\n<p>Với chính sách quy hoạch mới của thành phố Hà Nội, các Bộ ngành quan trọng đã được chuyển trụ sở từ khu vực nội đô về tại khu vực Mễ Trì và Mỹ Đình. Có thể nhắc tới như Bộ Ngoại Giao, Bộ Công An, Bộ Nộ Vụ và Bộ Tài nguyên Môi trường,… là những bộ ngành hiện đã chuyển về khu vực này. Trong thời gian tới đây, các trụ sở bộ ngành khách cũng sẽ được dịch chuyển về khu vực này khiến cho Mỹ Đình đích thực là trung tâm hành chính mới của Thủ đô.</p>\r\n\r\n<p>Đây cũng là khu vực tập trung nhiều trường học quốc tế, trường học trọng điểm như Trường liên cấp Marie Curie, Trường Đoàn Thị Điểm, Trường Lương Thế Vinh, Trường Chuyên Amsterdam hay ĐH FPT, ĐH Thương Mại, ĐH Ngoại ngữ, ĐH Sư Phạm,… mang lại một hệ thống giáo dục uy tín và chất lượng hàng đầu.</p>\r\n\r\n<p><img src=\"http://localhost/mipec-xuanthuy/storage/app/media/uploaded-files/1574789150507.jpeg\" alt=\"Trường Marie Curie Hanoi\" width=\"1300\" height=\"665\" srcset=\"https://matrixonemetri.com/wp-content/uploads/2019/11/truong-marie-curie-hanoi.jpg 1300w, https://matrixonemetri.com/wp-content/uploads/2019/11/truong-marie-curie-hanoi-700x358.jpg 700w, https://matrixonemetri.com/wp-content/uploads/2019/11/truong-marie-curie-hanoi-768x393.jpg 768w\" sizes=\"(max-width: 1300px) 100vw, 1300px\" class=\"fr-fic fr-dii\" data-result=\"success\"></p>\r\n\r\n<p>Làm nên chuỗi liên kết vùng hoàn hảo với các yếu tố “điện – đường – trường – trạm”, khu vực Mỹ Đình – Mễ Trì còn sở hữu nhiều bệnh viện tuyến đầu như Bệnh viện 198, Bệnh viện Đa khoa Y học cổ truyền, Viện Huyết học TW, Bệnh viện Thể thao,… đảm bảo sức khỏe của cư dân một cách trọn vẹn và chất lượng nhất.&nbsp;</p>\r\n\r\n<p>Bên cạnh đó, cư dân khu vực này còn được tận hưởng mua sắm giải trí thỏa thích với nhiều trung tâm thương mại lớn như Metro, The Garden, Vincom Sky Lake, Vincom Trần Duy Hưng, Big C,… đáp ứng trọn vẹn mọi yêu cầu cuộc sống của cư dân nước ngoài với các tiêu chí sống đẳng cấp.</p>\r\n\r\n<blockquote>\r\n\r\n	<p>Nên xem ngay:&nbsp;<strong><a href=\"https://matrixonemetri.com/vi-tri/\">Vị trí dự án The Matrix One</a></strong>, khu căn hộ cao cấp của MIK Group nằm ngay nút giao Lê Quang Đạo – Mễ Trì.</p>\r\n</blockquote>\r\n\r\n<p><em>Sự phát triển kinh tế – xã hội và hành chính là đòn bẩy mạnh mẽ để thúc đẩy sự phát triển của bất động sản nơi đây. Với những tiềm năng đã và đang khai thác, khu vực này sẽ còn phát triển mạnh mẽ đồng thời là lựa chọn an cư lý tưởng nhất dành cho cộng đồng cư dân ngoại quốc tại Thủ đô.</em></p>', '2019-11-26 10:39:34', '1', 0, '2019-11-26 10:26:07', '2019-11-26 11:42:31', '/can-ho-dang-cap.jpg', 1, NULL, 1, 0, '', 1, NULL, NULL, NULL, NULL, NULL),
(2, 'Danh mục nội thất bàn giao chung cư Mipec', 'danh-muc-noi-ban-giao-chung-cu-matrix-one', '<p>Thuộc phân khúc căn hộ hạng sang hướng tới đối tượng khách hàng tinh hoa của xã hội, những con người ưu việt có chung một đẳng cấp sống thượng lưu, dự án The Mipec &nbsp;được hoàn thiện nội thất cao cấp theo tiêu chuẩn quốc tế, bởi vậy nơi đây trở thành không gian sống chất mà bất kỳ gia đình nào đều mong muốn sở hữu.</p>', '<p>Thuộc phân khúc căn hộ hạng sang hướng tới đối tượng khách hàng tinh hoa của xã hội, những con người ưu việt có chung một đẳng cấp sống thượng lưu, dự án The Matrix One được hoàn thiện nội thất cao cấp theo tiêu chuẩn quốc tế, bởi vậy nơi đây trở thành không gian sống chất mà bất kỳ gia đình nào đều mong muốn sở hữu.</p>\r\n\r\n<p>\r\n	<br>\r\n</p>\r\n\r\n<p>Để Quý khách nắm rõ chi tiết thông số về&nbsp;<a href=\"https://matrixonemetri.com/\">căn hộ The Matrix One Mễ Trì</a>, dưới đây chúng tôi sẽ trích dẫn danh mục các nguyên vật liệu và thiết bị bàn giao căn hộ của dự án theo công bố mới nhất của MIK Group ngày 22/11/2019.</p>\r\n\r\n<p>\r\n	<br>\r\n</p>\r\n\r\n<h2><strong>Chi tiết vật liệu và thiết bị bàn giao căn hộ The Matrix One</strong></h2>\r\n<figure aria-describedby=\"caption-attachment-628\"><img src=\"http://localhost/mipec-xuanthuy/storage/app/media/uploaded-files/1574789228590.jpeg\" alt=\"Nội thất bàn giao The Matrix One\" width=\"1600\" height=\"839\" srcset=\"https://matrixonemetri.com/wp-content/uploads/2019/11/noi-that-ban-giao-the-matrix-one.jpg 1600w, https://matrixonemetri.com/wp-content/uploads/2019/11/noi-that-ban-giao-the-matrix-one-700x367.jpg 700w, https://matrixonemetri.com/wp-content/uploads/2019/11/noi-that-ban-giao-the-matrix-one-768x403.jpg 768w\" sizes=\"(max-width: 1600px) 100vw, 1600px\" class=\"fr-fic fr-dii\" data-result=\"success\">\r\n	<figcaption>Page 1</figcaption>\r\n</figure>\r\n<figure aria-describedby=\"caption-attachment-625\"><img src=\"http://localhost/mipec-xuanthuy/storage/app/media/uploaded-files/1574789230755.jpeg\" alt=\"Danh mục nội thất bàn giao dự án The Matrix One\" width=\"1600\" height=\"838\" srcset=\"https://matrixonemetri.com/wp-content/uploads/2019/11/noi-that-ban-giao-the-matrix-one-2.jpg 1600w, https://matrixonemetri.com/wp-content/uploads/2019/11/noi-that-ban-giao-the-matrix-one-2-700x367.jpg 700w, https://matrixonemetri.com/wp-content/uploads/2019/11/noi-that-ban-giao-the-matrix-one-2-768x402.jpg 768w\" sizes=\"(max-width: 1600px) 100vw, 1600px\" class=\"fr-fic fr-dii\" data-result=\"success\">\r\n	<figcaption>Page 2</figcaption>\r\n</figure>\r\n<figure aria-describedby=\"caption-attachment-629\"><img src=\"http://localhost/mipec-xuanthuy/storage/app/media/uploaded-files/1574789230425.jpeg\" alt=\"Nội thất bàn giao The Matrix One Mễ Trì\" width=\"1600\" height=\"838\" srcset=\"https://matrixonemetri.com/wp-content/uploads/2019/11/noi-that-ban-giao-the-matrix-one-4.jpg 1600w, https://matrixonemetri.com/wp-content/uploads/2019/11/noi-that-ban-giao-the-matrix-one-4-700x367.jpg 700w, https://matrixonemetri.com/wp-content/uploads/2019/11/noi-that-ban-giao-the-matrix-one-4-768x402.jpg 768w\" sizes=\"(max-width: 1600px) 100vw, 1600px\" class=\"fr-fic fr-dii\" data-result=\"success\">\r\n	<figcaption>Page 4</figcaption>\r\n</figure>', '2019-11-26 10:39:26', '1', 0, '2019-11-26 10:28:01', '2019-11-28 19:35:29', '/chi-tiet-can-ho-the-matrix-one-16.jpg', 1, NULL, 1, 0, '', 1, NULL, NULL, NULL, NULL, NULL),
(3, 'Vì sao TheMipec  lọt vào mắt xanh của các nhà đầu tư?', 'vi-sao-matrix-one-lot-vao-mat-xanh-cua-cac-nha-dau-tu', '<p><strong>Gây sốt ngay từ khi mới ra mắt vì sở hữu tòa nhà cao nhất tại Hà Nội, dự án Mipec &nbsp;đích thực chính là biểu tượng bất động sản mới mà các nhà đầu tư đang tìm kiếm.</strong></p>', '<h2><strong>Sức hấp dẫn đến từ vị trí độc tôn&nbsp;</strong></h2>\r\n\r\n<p>Mặc dù chỉ mới ra mắt thị trường thời gian gần đầy nhưng The Matrix One đã nhanh chóng trở thành siêu phẩm hot nhất trên thị trường bất động sản của Hà Nội với sự quan tâm và đón nhận của đông đảo khách hàng.</p>\r\n\r\n<p>Tọa lạc vị trí đắc địa ngay nút giao của nhiều tuyến đường huyết mạch như Mễ Trì, Châu Văn Liêm và Lê Quang Đạo tạo thành một hệ thống hạ tầng giao thông đồng bộ hiện đại, dễ dàng liên kết đến bất cứ nơi đâu trong thành phố cũng như các vùng lân cận. Đặc biệt nơi đây còn nằm trong khu vực trung tâm hành chính – kinh tế mới của Thủ đô với sức phát triển mạnh mẽ cùng nhiều tiềm năng đã và đang được khai thác.</p>\r\n<figure aria-describedby=\"caption-attachment-586\"><img data-fr-image-pasted=\"true\" src=\"https://matrixonemetri.com/wp-content/uploads/2019/11/the-matrix-one-tam-nhin-om-tron-cong-vien-14ha.jpg\" data-src=\"https://matrixonemetri.com/wp-content/uploads/2019/11/the-matrix-one-tam-nhin-om-tron-cong-vien-14ha.jpg\" alt=\"The Matrix One tầm nhìn ôm trọn công viên 14ha\" width=\"1600\" height=\"907\" srcset=\"https://matrixonemetri.com/wp-content/uploads/2019/11/the-matrix-one-tam-nhin-om-tron-cong-vien-14ha.jpg 1600w, https://matrixonemetri.com/wp-content/uploads/2019/11/the-matrix-one-tam-nhin-om-tron-cong-vien-14ha-700x397.jpg 700w, https://matrixonemetri.com/wp-content/uploads/2019/11/the-matrix-one-tam-nhin-om-tron-cong-vien-14ha-768x435.jpg 768w\" data-srcset=\"https://matrixonemetri.com/wp-content/uploads/2019/11/the-matrix-one-tam-nhin-om-tron-cong-vien-14ha.jpg 1600w, https://matrixonemetri.com/wp-content/uploads/2019/11/the-matrix-one-tam-nhin-om-tron-cong-vien-14ha-700x397.jpg 700w, https://matrixonemetri.com/wp-content/uploads/2019/11/the-matrix-one-tam-nhin-om-tron-cong-vien-14ha-768x435.jpg 768w\" sizes=\"(max-width: 1600px) 100vw, 1600px\" class=\"fr-fic fr-dii\">\r\n	<figcaption><em>Tầm nhìn ôm trọn đường đua F1 và công viên chủ đề 14ha</em></figcaption>\r\n</figure>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Được thiết kế bởi các chuyên gia hàng đầu, bên cạnh hai tòa căn hộ cao 44 tầng, dự án còn sở hữu một tòa tháp đặc biệt với chiều cao 73 tầng, là đại diện mới cho ngôi vị tòa nhà cao nhất Thủ đô. Mang phong cách Châu Âu hiện đại, dự án kiến tạo nên một không gian sống hiện đại, đẳng cấp và sang trọng đồng thời thân thiện và hòa hợp với môi trường.</p>\r\n\r\n<p>Với mong muốn hình thành một chuẩn mực sống đẳng cấp quốc tế, dự án đem đến cho cư dân của mình những trải nghiệm tuyệt vời, mới mẻ và đặc sắc. Hứa hẹn sẽ tạo nên một chốn an cư lý tưởng phù hợp cho mọi gia đình Việt.</p>\r\n\r\n<h2><strong>Căn hộ hiện đại đẳng cấp</strong></h2>\r\n\r\n<p>Dưới bàn tay các kiến trúc sư hàng đầu quốc tế,&nbsp;<a href=\"https://matrixonemetri.com/\">chung cư The Matrix One</a> gây ấn tượng bởi những đường nét thiết kế linh hoạt, gọn gàng giúp tối ưu hóa diện tích và công năng sử dụng. Các phòng chức năng được sắp xếp hợp lý, liên kết với nhau bởi các khoảng không gian mở khiến căn hộ cảm giác thoáng mát, rộng rãi hơn so với diện tích thực của mình.&nbsp;</p>\r\n\r\n<p>Hệ thống nội thất cao cấp với những sản phẩm chất lượng 5 sao, hứa hẹn sẽ mang đến cho cư dân tương lai của mình những vật liệu nội thất không chỉ đạt yêu cầu về chất mà còn mang đầy cá tính thẩm mỹ riêng. Với hệ thống nội thất cao cấp, cư dân sẽ được đáo ứng trọn vẹn mọi nhu cầu sống và làm việc tại nơi này.</p>\r\n<figure aria-describedby=\"caption-attachment-585\"><img data-fr-image-pasted=\"true\" src=\"https://matrixonemetri.com/wp-content/uploads/2019/11/noi-that-can-ho-dang-cap-cua-mik-me-tri.jpg\" data-src=\"https://matrixonemetri.com/wp-content/uploads/2019/11/noi-that-can-ho-dang-cap-cua-mik-me-tri.jpg\" alt=\"Nội thất căn hộ đẳng cấp của MIK Mễ Trì\" width=\"1300\" height=\"731\" srcset=\"https://matrixonemetri.com/wp-content/uploads/2019/11/noi-that-can-ho-dang-cap-cua-mik-me-tri.jpg 1300w, https://matrixonemetri.com/wp-content/uploads/2019/11/noi-that-can-ho-dang-cap-cua-mik-me-tri-700x394.jpg 700w, https://matrixonemetri.com/wp-content/uploads/2019/11/noi-that-can-ho-dang-cap-cua-mik-me-tri-768x432.jpg 768w\" data-srcset=\"https://matrixonemetri.com/wp-content/uploads/2019/11/noi-that-can-ho-dang-cap-cua-mik-me-tri.jpg 1300w, https://matrixonemetri.com/wp-content/uploads/2019/11/noi-that-can-ho-dang-cap-cua-mik-me-tri-700x394.jpg 700w, https://matrixonemetri.com/wp-content/uploads/2019/11/noi-that-can-ho-dang-cap-cua-mik-me-tri-768x432.jpg 768w\" sizes=\"(max-width: 1300px) 100vw, 1300px\" class=\"fr-fic fr-dii\">\r\n	<figcaption><em>Nội thất hoàn thiện căn hộ được nhập khẩu từ các thương hiệu hàng đầu Thế giới</em></figcaption>\r\n</figure>\r\n\r\n<p>Đặc biệt hơn, vưới hệ thống ban công rộng lớn với tầm view hút mắt, cư dân The Matrix One vừa có thể theo dõi những màn đua xe đặc sắc trên đường đua F1 đồng thời tận hưởng nguồn năng lượng sống dồi dào của thiên nhiên từ công viên sinh thái.</p>\r\n\r\n<p>Bên cạnh đó, cư dân sẽ được trải nghiệm hệ thống dịch vụ tiện ích đa dạng hấp dẫn được trang bị theo tiêu chuẩn quốc tế đỉnh cao, khép kín trong khuôn viên dành riêng cho những cư dân của The Matrix One.</p>\r\n\r\n<h2><strong>Lựa chọn đầu tư sinh lời hoàn hảo</strong></h2>\r\n\r\n<p>Không chỉ là chốn an cư lý tưởng mà The Matrix One còn là kênh đầu tư sinh lời hiệu quả với những nguồn khách dồi dào và cam kết giá cho thuê căn hộ vô cùng hấp dẫn.</p>\r\n\r\n<p>Sở hữu vị trí đắc địa nằm ngay trung tâm hành chính – kinh tế – văn hóa hàng đầu khu vực phía Tây, nơi đây tập trung đông đúc dân cư, phần nhiều là dân văn phòng, sinh viên và các gia đình trẻ. Hơn thế nữa, The Matrix One còn sở hữu tòa cao ốc văn phòng biểu tượng mới của Thủ đô cao 73 tầng, mang đến cho các nhà đầu tư căn hộ cho thuê một nguồn lớn khách hàng để có thể khai thác.&nbsp;</p>\r\n\r\n<p><img data-fr-image-pasted=\"true\" src=\"https://matrixonemetri.com/wp-content/uploads/2019/11/truong-hoc-quoc-te-the-matrix-one-me-tri.jpg\" data-src=\"https://matrixonemetri.com/wp-content/uploads/2019/11/truong-hoc-quoc-te-the-matrix-one-me-tri.jpg\" alt=\"Trường học quốc tế tại The Matrix One Mễ Trì\" width=\"1500\" height=\"840\" srcset=\"https://matrixonemetri.com/wp-content/uploads/2019/11/truong-hoc-quoc-te-the-matrix-one-me-tri.jpg 1500w, https://matrixonemetri.com/wp-content/uploads/2019/11/truong-hoc-quoc-te-the-matrix-one-me-tri-700x392.jpg 700w, https://matrixonemetri.com/wp-content/uploads/2019/11/truong-hoc-quoc-te-the-matrix-one-me-tri-768x430.jpg 768w\" data-srcset=\"https://matrixonemetri.com/wp-content/uploads/2019/11/truong-hoc-quoc-te-the-matrix-one-me-tri.jpg 1500w, https://matrixonemetri.com/wp-content/uploads/2019/11/truong-hoc-quoc-te-the-matrix-one-me-tri-700x392.jpg 700w, https://matrixonemetri.com/wp-content/uploads/2019/11/truong-hoc-quoc-te-the-matrix-one-me-tri-768x430.jpg 768w\" sizes=\"(max-width: 1500px) 100vw, 1500px\" class=\"fr-fic fr-dii\"></p>\r\n\r\n<p>So với các căn hộ cho thuê trong khu vực, The Matrix One Mễ Trì ghi điểm bởi thiết kế căn hộ thông minh sang trộng đặc biệt là chuỗi tiện ích hấp dẫn được đồng bộ theo tiêu chuẩn quốc tế, kiến tạo nên một cuộc sống đẳng cấp đích thực. Đây chính là lợi thế giúp gia tăng giá trị thuê căn hộ nơi đây.</p>\r\n\r\n<p>The Matrix One với mức giá hợp lý cùng loạt chính sách bán hàng đầy ưu đãi và hấp dẫn, trực tiếp từ đơn vị Chủ đầu tư mang đến những giải pháp tài chính hợp lý để các khách hàng dễ dàng sở hữu căn hộ đồng thời vẫn nhanh chóng thu về lợi nhuận từ việc cho thuê.</p>\r\n\r\n<blockquote>\r\n\r\n	<p>Xem chi tiết:&nbsp;<a href=\"https://matrixonemetri.com/gia-ban/\">Giá bán căn hộ The Matrix One Hà Nội&nbsp;</a></p>\r\n</blockquote>\r\n\r\n<p><em>Hội tụ những ưu điểm vượt trội, dự án The Matrix One đang là cái tên được đông đảo các nhà đầu tư thông thái tìm kiếm. Hãy nhanh chóng trở thành chủ nhân căn hộ đẳng cấp nơi đây và sinh lời đích thực từ túi tiền của mình.</em></p>', '2019-11-26 10:39:19', '1', 0, '2019-11-26 10:29:09', '2019-11-28 19:35:43', '/be-boi-the-matrix.jpg', 1, NULL, 1, 0, '', 1, NULL, NULL, NULL, NULL, NULL),
(4, 'Người dân đổ bộ thị trường  dự án Mipec', 'nguoi-dan-do-bo-thi-truong-du-mipec', '<p>Trong tháng 10/2019 vừa qua, bên cạnh việc công bố phát triển dự án Imperia Smart City thì MIK Group cũng đã chính thức công bố phát triển tổ hợp căn hộ cao cấp Mipec – biểu tượng sống mới hiện đại và đẳng cấp phía Tây Thủ đô.</p>', '<h2>The Matrix One – biểu tượng mới của bất động sản phía Tây</h2>\r\n\r\n<p>MIK Group là một trong những đơn vị phát triển bất động sản hàng đầu tại Việt Nam với nhiều dự án được đánh giá cao trên thị trường như Imperia Sky Garden, Movenpick Phú Quốc, Park Riverside,… Luôn chú trọng đến chất lượng sản phẩm cùng những trải nghiệm sống đẳng cấp nhất, MIK Group hướng tới phát triển The Matrix One trở thành chốn an cư lý tưởng của mọi gia đình Việt, là nơi hội tụ đầy đủ những tinh hoa cuộc sống làm nên những phút giây bất tận.</p>\r\n\r\n<p><img src=\"http://localhost/mipec-xuanthuy/storage/app/media/uploaded-files/1574789919197.jpeg\" alt=\"MIK Group ra mắt toà tháp 44 tàng The Matrix One\" width=\"980\" height=\"1208\" srcset=\"https://matrixonemetri.com/wp-content/uploads/2019/11/mik-group-ra-mat-toa-thap-44-tang-the-matrix-one.jpg 980w, https://matrixonemetri.com/wp-content/uploads/2019/11/mik-group-ra-mat-toa-thap-44-tang-the-matrix-one-325x400.jpg 325w, https://matrixonemetri.com/wp-content/uploads/2019/11/mik-group-ra-mat-toa-thap-44-tang-the-matrix-one-768x947.jpg 768w\" sizes=\"(max-width: 980px) 100vw, 980px\" class=\"fr-fic fr-dii\" data-result=\"success\"></p>\r\n\r\n<p>Tọa lạc vị trí đắc địa ngay ngã tư giao điểm của các tuyến đường trọng điểm là Mễ Trì, Lê Quang Đạo và Châu Văn Liêm, nơi đây được xem như một trung tâm hành chính – kinh tế – văn hóa mới hàng đầu của Thủ đô. Đồng thời đây cũng là khu vực có các trụ sở ban hàng cấp bố được chuyển tới, đầu tiên chính là Bộ Ngoại giao – nằm ngay bên cạnh dự án The Matrix One.</p>\r\n\r\n<p>Sở hữu giao thông đồng bộ linh hoạt dễ dàng kết nối và di chuyển, nơi đây còn được biết đến với liên kết vùng hoàn hảo với nhiều công trình trường học, bệnh viện, sân vận động, bến xe,… phục vụ mọi nhu cầu của cư dân một cách nhanh chóng và trọn vẹn nhất.</p>\r\n\r\n<p>Được quy hoạch với tổng diện tích hơn 200 337m2, dự án bao gồm 3 tòa căn hộ cao tầng và khu vực công viên giải trí sinh thái. Trong đó, nổi bật chính là tòa văn phòng dịch vụ với chiều cao 73 tầng – vượt qua nhiều công trình khác hiện nắm giữ vị thế tòa nhà cao nhất tại Thủ đô.</p>\r\n\r\n<p>Hướng tới giới khách hàng thượng lưu,&nbsp;<a href=\"https://matrixonemetri.com/\"><strong>chung cư The Matrix One</strong></a> mang đến những căn hộ được thiết kế thanh sang, đẳng cấp xứng tầm với chủ nhân của mình. Mọi chi tiết, sản phẩm nội thất đều được chủ đầu tư MIK Group tuyển chọn kỹ càng từ những thương hiệu hàng đầu trong nước và quốc tế.</p>\r\n<figure aria-describedby=\"caption-attachment-571\"><img src=\"http://localhost/mipec-xuanthuy/storage/app/media/uploaded-files/1574789919429.jpeg\" alt=\"Công viên Nam Từ Liêm lá phổi xanh phía Tây Hà Nội\" width=\"1600\" height=\"800\" srcset=\"https://matrixonemetri.com/wp-content/uploads/2019/11/cong-vien-nam-tu-liem-la-phoi-xanh-cho-phia-tay.jpg 1600w, https://matrixonemetri.com/wp-content/uploads/2019/11/cong-vien-nam-tu-liem-la-phoi-xanh-cho-phia-tay-700x350.jpg 700w, https://matrixonemetri.com/wp-content/uploads/2019/11/cong-vien-nam-tu-liem-la-phoi-xanh-cho-phia-tay-768x384.jpg 768w\" sizes=\"(max-width: 1600px) 100vw, 1600px\" class=\"fr-fic fr-dii\" data-result=\"success\">\r\n	<figcaption><em>Công viên Nam Từ Liêm rộng 14hecta sẽ là phổi xanh cho khu vực Mỹ Đình</em></figcaption>\r\n</figure>\r\n\r\n<p>Hệ thống cảnh quan xanh bao quanh các tòa căn hộ cũng với khu công viên giải trí, sinh thái mang đến một không gian sống xanh an lành với nguồn năng lượng dồi dào, đích thực từ thiên nhiên kiến tạo một môi trường sống lý tưởng mà mọi gia đình đều mong muốn sở hữu.</p>\r\n\r\n<p>Sống tại The Matrix One Mễ Trì, cư dân sẽ được tận hưởng trọn vẹn những tiện ích tiêu chuẩn xứng tầm thế giới, đáp ứng trọn vẹn cuộc sống của cư dân một cách đích thực nhất. Đặc biệt, cư dân The Matrix One còn có cơ hội đặc biệt thưởng thức những màn đua xe F1 đỉnh cao ngay trong chính căn hộ của mình – đây là điều mà các dự án khác khó có thể sở hữu được.</p>\r\n\r\n<p>Thị trường phía Tây vốn là mảnh đất tiềm năng bậc nhất trên thị trường bất động sản Thủ đô. Với những giá trị sống đắt giá của mình, The Matrix One đích thực sẽ trở thành biểu tượng mới của nơi đây và là sự lựa chọn hàng đầu dành cho mọi khách hàng thông thái.</p>', '2019-11-26 10:39:06', '1', 0, '2019-11-26 10:38:52', '2019-11-28 19:35:13', '/ban-do-tien-ich-du-an-the-matrix-one.jpg', 1, NULL, 1, 0, '', 1, NULL, NULL, NULL, NULL, NULL),
(5, '5 phút', '5-phut', '<ul>\r\n	<li>Bộ ngoại giao</li>\r\n	<li>Trung tâm hội nghị Quốc gia</li>\r\n	<li>Sân vận động quốc gia Mỹ Đình</li>\r\n	<li>Đường đua công thức F1</li>\r\n	<li>Trung tâm thương mại The Garden</li>\r\n</ul>', '', '2019-12-02 09:50:09', '1', 0, '2019-12-02 09:50:09', '2019-12-02 09:50:09', '', 1, NULL, 2, 0, NULL, 1, 'vitri', NULL, NULL, NULL, NULL),
(6, '10 phút', '10-phut', '<ul>\r\n	<li>Bệnh viện 19-8</li>\r\n	<li>Bến xe khách Mỹ Đình</li>\r\n	<li>Đại học Sư Phạm Hà Nội</li>\r\n	<li>Trường Đại học Thương mại</li>\r\n	<li>TTTM Vincom Sky Lake</li>\r\n</ul>', '', '2019-12-02 09:52:03', '1', 0, '2019-12-02 09:50:44', '2019-12-02 09:52:03', '', 1, NULL, 2, 0, '', 1, 'vitri', NULL, NULL, NULL, NULL),
(7, '15 phút', '15-phut', '<ul>\r\n	<li>Công viên nước Hồ Tây</li>\r\n	<li>Đại học Ngoại Thương Hà Nội</li>\r\n	<li>Toà nhà Lotte Mart</li>\r\n	<li>Công viên Thủ Lệ</li>\r\n</ul>', '', '2019-12-02 09:51:52', '1', 0, '2019-12-02 09:51:09', '2019-12-02 09:51:52', '', 1, NULL, 2, 0, '', 1, 'vitri', NULL, NULL, NULL, NULL),
(8, '25 phút', '25-phut', '<ul>\r\n	<li>Sân bay quốc tế Nội Bài</li>\r\n	<li>Phố đi bộ Hồ Gươm</li>\r\n</ul>', '', '2019-12-02 09:51:44', '1', 0, '2019-12-02 09:51:33', '2019-12-02 09:51:44', '', 1, NULL, 2, 0, '', 1, 'vitri', NULL, NULL, NULL, NULL),
(9, 'tiện ích 1', 'tien-ich-1', '<p>Trung tâm thương mại</p>\r\n\r\n<p>Bể bơi vô cực ngoài trời</p>\r\n\r\n<p>Sảnh lounge đón khách</p>\r\n\r\n<p>Spa chăm sóc sắc đẹp</p>\r\n\r\n<p>Phòng tập Gym – Yoga</p>\r\n\r\n<p>Khu vui chơi ngoài trời</p>', '', '2019-12-02 09:53:25', '1', 0, '2019-12-02 09:52:59', '2019-12-02 11:00:22', '', 1, NULL, 3, 0, '', 1, 'tienich1', NULL, NULL, NULL, NULL),
(10, 'tiện ích 2', 'tien-ich-2', '<p>Trường mầm chọn quốc tế</p>\r\n\r\n<p>Phòng khám bệnh – nhà thuốc</p>\r\n\r\n<p>Nhà hàng ẩm thực cao cấp</p>\r\n\r\n<p>Cafe ngoài trời</p>\r\n\r\n<p>Hầm đỗ xe thông minh</p>\r\n\r\n<p>Hệ thống an ninh 3 lớp</p>', '', '2019-12-02 09:53:32', '1', 0, '2019-12-02 09:53:15', '2019-12-02 11:00:35', '', 1, NULL, 3, 0, '', 1, 'tienich2', NULL, NULL, NULL, NULL);

