--

CREATE TABLE `mipec_home_` (
  `id` int(10) UNSIGNED NOT NULL,
  `title` varchar(150) COLLATE utf8mb4_unicode_ci NOT NULL,
  `description` varchar(150) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `content` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `image` varchar(150) COLLATE utf8mb4_unicode_ci DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

--
-- Đang đổ dữ liệu cho bảng `mipec_home_`
--

INSERT INTO `mipec_home_` (`id`, `title`, `description`, `content`, `image`) VALUES
(1, 'THE MATRIX ONE', 'Tinh hoa xứng tầm đẳng cấp thương lưu', '', ''),
(2, 'TỔNG QUAN THE MATRIX ONE', 'GIỚI THIỆU', '<p>Hội tụ những giá trị sống đích thực nhất,&nbsp;<a href=\"https://matrixonemetri.com/\"><strong>The Matrix One</strong></a> kiến tạo nên một không gian hiện đại và đẳng cấp với những trải nghiệm xứng tầm quốc tế. Tựa như một ma trận của những tinh hoa cuộc sống, trở thành biểu tượng an cư mới của cư dân phía Tây Thủ đô.</p>', '/phoi-canh.png'),
(3, 'TỔNG QUAN THE MATRIX ONE', 'CHỦ ĐẦU TƯ', '<p>The Matrix One là sản phẩm chiến lược của đơn vị chủ đầu tư MIK Group – một trong những thương hiệu phát triển bất động sản trẻ thành công với những dự án được đánh giá cao trên thị trường, được đông đảo khách hàng yêu thích và đón nhận như: Movenpick Phú Quốc, Park Riverside, Impeira Garden, Villa Park,… hứa hẹn sẽ trở thành điểm sáng trên thị trường cuối năm 2019. </p>', '/mik-group-nha-phat-trien-bat-dong-san-uy-tin.jpg'),
(4, 'TỔNG QUAN THE MATRIX ONE', 'ĐIỂM NHẤN', '<p>Kiến tạo nên một không gian sống hiện đại đẳng cấp, đồng thời cũng thân thiện gần gũi với thiên nhiên với hệ thống cảnh quan xanh bao quanh dự án cùng công viên hồ điều hòa Mỹ Đình,… mang tới một chốn an cư lý tưởng cho mọi gia đình Việt.</p>\r\n\r\n<p>Tinh tế và sang trọng trong phong cách sống, cư dân The Matrix One (tên thường gọi Golden Palace A) còn được trải nghiệm những tiện ích mới mẻ và hấp dẫn kiến tạo một cuộc sống trọn vẹn trong từng khoảnh khắc.</p>', '/diem-nhan-kien-truc-cua-the-matrix.jpg'),
(5, 'VỊ TRÍ TRUNG TÂM PHÍA TÂY', '', '<p>Toạ lạc ngay vị trí giao điểm của hai tuyến đường trọng điểm phía Tây là Lê Quang Đạo và Mễ Trì. Nằm trong khu vực trung tâm hành chính – kinh tế – văn hóa hàng đầu của Hà Nội, nơi đã được đồng bộ về hệ thống cơ sở hạ tầng giao thông hiện đại, kết nối với nhiều tuyến đường huyết mạch như Phạm Hùng, Xuân Thủy, Đại lộ Thăng Long, Lê Đức Thọ, Hồ Tùng Mậu,….</p>\r\n\r\n<p>Cư dân&nbsp;<strong>The Matrix One Mễ Trì</strong> cũng dễ dàng tiếp cận với các cơ quan ban ngành hay đáp ứng các nhu cầu cuộc sống như điện – đường – trường – trạm chỉ trong vòng bán kính 3km, với chất lượng dịch vụ tiện ích công cộng hàng đầu của Thủ đô.</p>', '/maps.jpg'),
(6, 'GIÁ TRỊ VÀNG THE MATRIX ONE', 'Công viên hồ điều hoà', '<p>Là một trong những điểm nhấn nổi bật của dự án The Matrix One, dự án nằm ngay cạnh công viên hồ điều hòa lớn nhất khu vực Mỹ Đình, quy mô lên tới 14.4ha không chỉ mang đến một môi trường sống xanh an lành cho cư dân nơi đây, mà còn là điểm đến vui chơi thư giãn lý tưởng dành cho cả gia đình với nhiều trải nghiệm vô cùng hấp dẫn đang đón chờ những cư dân tương lai. </p>', ''),
(7, 'GIÁ TRỊ VÀNG THE MATRIX ONE', 'Tầm nhìn đắt giá', '<p>The Matrix One sở hữu tầm nhìn đắt giá bao trọn toàn bộ khung cảnh lung linh khu vực phía Tây. Đặc biệt hơn, từ đây cư dân có thể đón xem tận mắt những màn đua xe công thức một quy mô quốc tế với những màn thể hiện không thể nào ấn tượng hơn. Hệ thống ban công được mở rộng mang tới cho quý cư dân những trải nghiệm mãn nhãn nhất đồng thời đem lại cho căn hộ nơi đây một nguồn năng lượng sống dồi dào, tràn đầy sức sống. </p>', ''),
(8, 'GIÁ TRỊ VÀNG THE MATRIX ONE', 'Kiến trúc ấn tượng', '<p>Không cầu kỳ hay quá hoa mỹ, <strong>dự án MIK Group tại Mễ Trì</strong> &nbsp;được tạo nên dưới đôi bàn tay tài hoa của các kiến trúc sư hàng đầu đến từ Hàn Quốc. Với phong cách thiết kế thanh lịch ấn tượng theo lối kiến trúc hiện đại, các căn hộ nơi đây được thiết kế tinh tế, tối ưu hoá công năng sử dụng, tạo nên những khoảng không gian riêng cho từng thành viên cũng như không gian sinh hoạt chung đầm ấm, quây quần.</p>', ''),
(9, 'GIÁ BÁN & THANH TOÁN', '', '<p>Hội tụ những tiêu chuẩn đắt giá của một khu căn hộ cao cấp, dự án The Matrix One dự kiến sẽ chính thức được chào bán ra thị trường vào quý IV/2019 với mức giá trung bình từ 65 – 70 triệu đồng/m2 (Giá bán gồm VAT và nội thất hoàn thiện tiêu chuẩn. </p>', '/can-ho-dang-cap.jpg');

