(1, 'CHUỖI TIỆN ÍCH ĐỈNH CAO', '', '<p>Dành phần lớn không gian cho không gian cảnh quan và tiện ích, chung cư The Matrix One được trang bị chuỗi dịch vụ tiện ích đa dạng, đồng bộ cùng hệ thống quản lý – vận hành thông minh, kiến tạo nên những trải nghiệm sống đích thực nhất. </p>', '/be-boi-bon-mua.jpg', '/khu-vui-choi-tre-em.jpg', '/vuon-dao-bo.jpg');

