--
-- Đang đổ dữ liệu cho bảng `mipec_home_matbang`
--

INSERT INTO `mipec_home_matbang` (`id`, `title`, `description`, `content`, `image`) VALUES
(1, 'MẶT BẰNG THE MATRIX ONE MỄ TRÌ', '', '<p>&nbsp;là sản phẩm chiến lược của MIK Group trong năm 2019 này.&amp;nbsp; Sở hữu mặt bằng rộng lớn được quy hoạch hiện đại với kiến trúc độc đáo, dự án hứa hẹn sẽ đem tới cho cư dân Hà thành một biểu tượng sống mới chất lượng và đẳng cấp.</p>', ''),
(2, 'QUY HOẠCH TỔNG THỂ', '', '<p>Dự án The Matrix One được xây dựng trên mặt bằng rộng lớn với tổng diện tích khu đất là 200 337m2 trong đó, diện tích khu công viên giải trí là 144 140m2, diện tích khu nhà thấp tầng là 10 447m2 và phần diện tích còn lại dùng để xây dựng chuỗi tòa căn hộ cao tầng.</p>\r\n\r\n<p>Với mật độ xây dựng khá thấp, dự án phát triển theo hướng tổ hợp căn hộ chung cư cao cấp, nhà phố thương mại, liền kề, biệt thự và công viên sinh thái giải trí đạt tiêu chuẩn chất lượng xứng tầm quốc tế.\r\n	<br><strong>– Khu nhà ở thấp tầng</strong>\r\n	<br>+ Loại hình phát triển: Biệt thự và Shophouse\r\n	<br>+ Kết cấu: 4 tầng và 1 tum\r\n	<br><strong>– Khu căn hộ chung cư</strong>\r\n	<br>+ Loại hình phát triển: Căn hộ 2 – 3 phòng ngủ\r\n	<br>+ Diện tích: 87.29m2 – 112.77m2</p>', '/quy-hoach-du-an-the-matrix-one.jpg'),
(3, 'MẶT BẰNG THIẾT KẾ CĂN HỘ', 'TOÀ A', '', '/mat-bang-toa-a-the-matrix-one.jpg'),
(4, 'MẶT BẰNG THIẾT KẾ CĂN HỘ', 'TOÀ B', '', '/mat-bang-toa-b-the-matrix-one.jpg'),
(8, 'HÌNH ẢNH CĂN HỘ MẪU THE MATRIX', '', '<p><strong>The Matrix One</strong> được tạo nên bởi đôi bàn tay của các kiến trúc sư hàng đầu đến từ thương hiệu DA – Hàn Quốc. Là những kiến trúc sư chuyên nghiệp với nhiều sản phẩm thiết kế trên toàn thế giới, DA mang đến một The Matrix One Mễ Trì vô cùng độc đáo và đẳng cấp theo phong cách hiện đại, sang trọng và thanh lịch.</p>\r\n\r\n<p>Các phòng chức năng được bố trí hợp lý, hạn chế các bức tường chắn tạo thành một không gian mở, tối ưu hóa công năng sử dụng căn hộ. The Matrix One vừa có không gian sinh hoạt chung rộng rãi đầm ấm cho cả gia đình đồng thời vẫn tạo ra những khoảng không gian riêng dành cho mỗi thành viên trong gia đình.</p>\r\n\r\n<p>Cửa sổ và ban công được bố trí tại những vị trí hợp lý, đón nhận được nhiều nhất năng lượng tự nhiên như ánh sáng và gió trời, mang bầu không khí tươi mới tràn ngập trong căn hộ.</p>', '/3pn-living-matrix-one-me-tri.jpg');

