  `id` int(10) UNSIGNED NOT NULL,
  `title` varchar(150) COLLATE utf8mb4_unicode_ci NOT NULL,
  `description` varchar(150) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `content` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `image` varchar(150) COLLATE utf8mb4_unicode_ci DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

--
-- Đang đổ dữ liệu cho bảng `mipec_home_tienich`
--

INSERT INTO `mipec_home_tienich` (`id`, `title`, `description`, `content`, `image`) VALUES
(1, 'TIỆN ÍCH SỐNG ĐỈNH CAO THE MATRIX ONE', '', '<p>Với mong muốn kiến tạo nên một biểu tượng sống mới xứng tầm cho người dân Thủ đô, MIK Group phát triển&nbsp;<a href=\"https://matrixonemetri.com/\"><strong>dự án The Matrix One</strong></a> trở thành nơi hội tụ đầy đủ mọi chuẩn mực sống hiện đại và đẳng cấp với những trải nghiệm dịch vụ tiện ích mới mẻ hấp dẫn. </p>', '/ban-do-tien-ich-du-an-the-matrix-one.jpg'),
(2, 'CÔNG VIÊN SINH THÁI GIẢI TRÍ', '', '<p>Không chỉ là điểm nhấn kiến trúc độc đáo mà công viên sinh thái giải trí là một trong những tiện ích hấp dẫn khách hàng hàng đầu. Được xây dựng với quy mô lên tới 144 000m2, công viên được quy hoạch hiện đại với những hàng cây xanh, lối đi dạo thoáng mát cùng những khu vườn an lành để cả gia đình có thể vui chơi thư giãn. Được bố trí với nhiều phân khu&amp;nbsp; vui chơi giải trí hấp dẫn, dự án hứa hẹn sẽ mang đến cho cư dân những trải nghiệm tuyệt vời tại đây.</p>', '/cong-vien-sinh-thai.jpg'),
(3, 'TRUNG TÂM THƯƠNG MẠI', '', '<p>Trung tâm thương mại được bố trí ngay tầng 1 của tòa căn hộ. Hội tụ các thương hiệu uy tín và đẳng cấp hàng đầu trên thị trường hiện nay, cư dân sẽ được thỏa sức mua sắm, đáp ứng đầy đủ mọi nhu cầu cư dân căn hộ The Matrix One.</p>', '/trung-tam-thuong-mai.jpg'),
(4, 'BỂ BƠI NGOÀI TRỜI', '', '<p>Bên cạnh khu công viên thì bể bơi ngoài trời được xem là điểm đến lý tưởng dành cho cư dân mọi lứa tuổi. Bể bơi được xây dựng phía ngoài khu căn hộ với diện tích đủ rộng đồng thời trang bị thiết bị kiếm soát nhiệt độ nước hiện đại tự động chỉnh theo mùa hứa hẹn sẽ làm say lòng mọi cư dân nơi này. </p>', '/be-boi-the-matrix.jpg'),
(5, 'PHÒNG TẬP GYM', '', '<p>Ngày nay vấn đề rèn luyện sức khỏe rất được cư dân chú trọng. Hệ thống phòng tập gym được trang bị các thiết bị tập luyện hiện đại, tiên tiến nhất với đa dạng bài tập phù hợp với từng mục đích không chỉ giúp cải thiện tăng cường sức khỏe mà còn làm đẹp thêm cho vóc dáng của cư dân chung cư The Matrix Mễ Trì.</p>', '/phong-tap-gym.jpg'),
(6, 'KHU VUI CHƠI TRẺ EM', '', '<p>Giữa thành phố đông đúc chật chội, việc có được một không gian vui chơi lành mạnh an toàn cho con trẻ là điều không phải dự án nào cũng có thể đem lại được. The Matrix One với diện tích rộng rãi được quy hoạch thông minh, tạo ra khoảng không gian tự nhiên ngoài trời để trẻ em có thể tự do vui chơi, khám phá, phát triển bản thân một cách toàn diện nhất.</p>', '/khu-vui-choi-tre-em.jpg'),
(7, 'AN NINH & AN TOÀN 24/7', '', '<p>Tại&nbsp;<a href=\"https://matrixonemetri.com/\">chung cư The Matrix One Mễ Trì</a>, cư dân sẽ được an tâm tận hưởng cuộc sống trọn vẹn trong từng khoảnh khắc với hệ thống an ninh được bảo đảm chặt chẽ 24/7. Không chỉ có đội ngũ bảo an chuyên nghiệp giàu kinh nghiệm mà nơi đây còn được trang bị hệ thống thiết bị giám sát hiện đại, tân tiến nhất hiện nay. </p>', '/an-ninh-chung-cu-the-matrix-one.jpg');

