--
-- Đang đổ dữ liệu cho bảng `mipec_home_tongquan`
--

INSERT INTO `mipec_home_tongquan` (`id`, `title`, `description`, `content`, `image`) VALUES
(1, 'GIỚI THIỆU', '', '<p>Tọa lạc vị trí đắc địa cửa ngõ phía Tây Thủ đô,&nbsp;<strong>dự án The Matrix One</strong> kiến tạo nên một chuẩn mực sống mới cho cư dân Hà thành, hội tụ đầy đủ những giá trị sống hiện đại và đẳng cấp nhất. </p>', ''),
(2, 'Tổng quan dự án The Matrix One', '', '<ul>\r\n	<li>Tên dự án: The Matrix One</li>\r\n	<li>Chủ đầu tư: Công ty cổ phần Đầu tư Mai Linh</li>\r\n	<li>Vị trí: Ngã tư Lê Quang Đạo – Mễ Trì, quận Nam Từ Liêm, Hà Nội</li>\r\n	<li>Đơn vị phát triển: MIK Group</li>\r\n	<li>Đơn vị quản lý sản phẩm: MIK Home</li>\r\n	<li>Tư vấn thiết kế: Công ty Baumschlager Eberle Architeten (BEA)</li>\r\n	<li>Đơn vị thiết kế cảnh quan: Công ty EDEN Landscape</li>\r\n	<li>Tư vấn giám sát: Công ty TNHH Tư vấn Đại học Xây dựng CCU</li>\r\n	<li>Đơn vị thiết kế công viên: Công ty TNHH SOM</li>\r\n	<li>Tổng thầu xây dựng: Coteccons</li>\r\n	<li>Ngân hàng bảo lãnh: Ngân hàng BIDV</li>\r\n	<li>Tổng diện tích dự án: 39.8ha&nbsp;</li>\r\n	<li>Loại hình phát triển: Công viên giải trí, trường học và tổ hợp nhà ở thương mại, dịch vụ</li>\r\n	<li>Quy mô khu cao tầng: 2 tòa tháp cao 44 tầng và 1 toà cao 73 tầng</li>\r\n	<li>Cơ cấu sản phẩm: 740 căn, 20 căn Shop Apartment và 2 căn Penhouse</li>\r\n	<li>Khởi công: Tháng 1/2019</li>\r\n	<li>Thời gian hoàn thành: Tháng 11/2021</li>\r\n</ul>', '/phoi-canh-the-hanoi .jpg');

