--
-- Cấu trúc bảng cho bảng `mipec_home_vitri`
--

CREATE TABLE `mipec_home_vitri` (
  `id` int(10) UNSIGNED NOT NULL,
  `title` varchar(150) COLLATE utf8mb4_unicode_ci NOT NULL,
  `description` varchar(150) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `content` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `image` varchar(150) COLLATE utf8mb4_unicode_ci DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

--
-- Đang đổ dữ liệu cho bảng `mipec_home_vitri`
--

INSERT INTO `mipec_home_vitri` (`id`, `title`, `description`, `content`, `image`) VALUES
(1, 'VỊ TRÍ DỰ ÁN THE MATRIX ONE', '', '<p>Được xem là biểu tượng sống đẳng cấp mới của Thủ đô Hà Nội, dự án The Matrix One sở hữu &nbsp;vị trí đắc địa ngay trung tâm cửa ngõ phía Tây làm nên giá trị đắt giá thu hút khách hàng. </p>', ''),
(2, 'KẾT NỐI GIAO THÔNG THUẬN LỢI', '', '<p>Dự án The Matrix One tọa lạc vị trí đắt giá giao giữa các tuyến đường Mễ Trì, Châu Văn Liêm, Lê Quang Đạo và Đại lộ Thăng Long. Đây là các tuyến đường huyết mạch trọng tâm cửa ngõ giao thương phía Tây thành phố, dễ dàng tiếp cận đến các tuyến đường trọng điểm khác cùng khu vực như Dương Đình Nghệ, Phạm Hùng, Hồ Tùng Mậu, đường vành đai 3,… giúp cư dân The Matrix One có thể dễ dàng di chuyển, kết nối đến bất cứ nơi đâu trong thành phố một cách nhanh chóng và dễ dàng nhất.</p>\r\n\r\n<p>Bên cạnh hệ thống giao thông đường bộ, cư dân nơi đây còn được tiếp cận với nhiều tuyến đường sắt đô thị trong tương lai với các tuyến số 5 (Văn Cao – Hòa Lạc), tuyến số 4 (Liên Hà – Bắc Thăng Long) hay tuyến số 8 (Sơn Động – Dương Xá).</p>', '/maps.jpg'),
(3, 'QUY HOẠCH CƠ SỞ HẠ TẦNG', '', '<p>Những năm gần đây, khu vực phía Tây được UBND thành phố chú trọng đầu tư phát triển trở thành một trung tâm kinh tế – văn hóa – hành chính mới của Hà Nội. Bởi vậy nơi đây được đầu tư cơ sở hạ tầng hiện đại, đồng bộ phục vụ nhu cầu cư dân cùng sự đô thị hóa thần tốc của phía Tây thời gian qua.</p>\r\n\r\n<p>Hiện tại, cơ sở hạ tầng phía Tây gần như được hoàn thiện với hệ thống giao thông đồng bộ linh hoạt với các tuyến đường vành đai 3, 3.5 và 4 (tuyến đường số 4 đang trong kế hoạch triển khai). Nhờ hệ thống hạ tầng giao thông đồng bộ như vậy, cư dân không chỉ dễ dàng kết nối trong nội thành mà còn dễ dàng di chuyển, tiếp cận đến tất cả các vùng ngoại đô, tỉnh thành lân cận để nơi đây trở thành trung tâm kết nối của mọi miền.</p>', '/quy-hoach-co-so-ha-tang-the-matrix-one-me-tri.jpg'),
(4, 'LIÊN KẾT VÙNG HOÀN HẢO', '', '<p>Sở hữu vị trí đắt giá “trái tim” khu phía Tây, nhờ vậy mà chung cư The Matrix One&lt;/a&gt; được thừa hưởng hệ thống liên kết vùng hoàn hảo với những dịch vụ, tiện ích công cộng đa dạng và chất lượng nhất.</p>\r\n\r\n<p>Trong vòng bán kính 2km kể từ dự án, cư dân sẽ được tiếp cận với đầy đủ các dịch vụ tiện ích, đáp ứng trọn vẹn nhất mọi nhu cầu cuộc sống của cư dân.</p>', '/lien-ket-vung-the-matrix-me-tri.jpg');

